import React from "react";
import Table from 'react-bootstrap/Table';
import {flight} from "../AirData";
import '../App.css';

const flights = (props) => {
    const flightData = props.flightData;
    console.log(flightData);
    const keys = Object.keys(flightData);
    return (
        <div>
            <Table bordered id = "table1">
                <thead>
                    <tr>
                        <th>Airline</th>
                        <th>Slight Delay</th>
                        <th>Moderate Delay</th>
                        <th>Large Delay</th>
                    </tr>
                </thead>
                <tbody>
                    {
                        keys.map(data_key => (
                        <tr>
                          <td>{flightData[data_key].combinedFlightNumber}</td>
                          <td>{flight[data_key].sDelay}</td>
                          <td>{flight[data_key].mDelay}</td>
                          <td>{flight[data_key].lDelay}</td>
                        </tr>
                    ))
                    }
                </tbody>
            </Table>
        </div>
    );
}
export default flights;
